#!/bin/sh
echo "One moment...."
sleep 1
for (( c=1; c<=500; c++ ))
do
   echo "
"
done
cd /root
BASEDIR=$(pwd)

if test "$BASEDIR" != '/root'; then
  echo "I am NOT in /root which is where I want to be.  Check I am running as root";
  exit;
fi

echo 'V1.0
'
echo '' | base64 -d
[ -f /etc/redhat-release ] && echo "" || exit
sleep 1
echo "


";
sleep 2

echo "# MariaDB 10.6 CentOS repository list - created 2022-01-31 23:30 UTC
# https://mariadb.org/download/
[mariadb]
name = MariaDB
baseurl = https://mirrors.xtom.nl/mariadb/yum/10.6/centos8-amd64
module_hotfixes=1
gpgkey=https://mirrors.xtom.nl/mariadb/yum/RPM-GPG-KEY-MariaDB
gpgcheck=1
" >/etc/yum.repos.d/MariaDB.repo

echo "Installing EPL release..."
dnf -y install https://dl.fedoraproject.org/pub/epel/epel-release-latest-8.noarch.rpm >/root/install.log 2>/root/install.err

echo "Installing config manager..."
dnf -y config-manager --set-enabled powertools >>/root/install.log 2>>/root/install.err

echo "Upgrading server..."
dnf -y upgrade >>/root/install.log 2>>/root/install.err

echo "Installing modules..."
dnf -y install net-tools firewalld gcc gcc-c++ make openssl-devel git libdb-devel openssl-devel rclone libaio libsepol lsof boost-build boost-program-options mod_ssl redis  memcached.x86_64 libmemcached.x86_64 libmemcached-libs.x86_64 systemd-devel systemd-libs cpan traceroute telnet sysbench libpng-devel zlib-devel  libgcrypt libgcrypt-devel compat-libpthread-nonshared bzip2 google-authenticator qrencode-libs bind-utils ncdu nodejs libsecret-devel gnupg1.x86_64 scl-utils gcc-toolset-9 git cmake3 zlib-devel boost-devel boost boost-devel glpk glpk-devel nload wget chrony firewalld tar bind-utils.x86_64 policycoreutils-python-utils curl kpatch  percona-server-server percona-server-client percona-xtrabackup-80 percona-toolkit percona-mysql-shell pmm-client libuv-devel >>/root/install.log 2>>/root/install.err

authselect select minimal with-silent-lastlog --force >>/root/install.log 2>>/root/install.err

curl https://github.com/squizzster/ginstall/blob/26e6680c125c9f8c77fbdf062151b95c431b3956/asio-devel-1.10.8-7.module_el8.3.0+757+d382997d.x86_64.rpm | rpm -i


echo "Patching the kernel...."
dnf -y kpatch auto      >>/root/install.log 2>>/root/install.err
systemctl enable kpatch >>/root/install.log 2>>/root/install.err
systemctl start kpatch  >>/root/install.log 2>>/root/install.err
systemctl stop kpatch
systemctl disable kpatch


echo "Enabling time keeping"
systemctl enable chronyd >>/root/install.log 2>>/root/install.err

echo "Starting chronyd"
systemctl start chronyd >>/root/install.log 2>>/root/install.err



